const Home = () => {
  return (
    <div className="page">
      <div className="home-content">
        <img src="/your_picture.jpg" alt="Your Name" className="profile-picture" />
        <h1>Welcome to My Website</h1>
        <p>
          Hello, I'm Your Name, a passionate web developer.
          Let's explore the universe of technology together!
        </p>
      </div>
    </div>
  );
};

export default Home;
